 */
import React, { useEffect } from "react";
import { getItem } from "utils/loashTools";
import './index.css'
export const Mul_Tag = ({value,onChange,...rest}) => {
    const {addons} = rest
    useEffect(() => {
        console.log(rest);
    },[])
    getItem = () => {
        if(addons.dependValues[0] == true && value.length == 0){
            onChange([{title:'标签一',},{title:"标签二"},{title:'标签三'}])
        }
    }
    return (
        <div className="total_tags">
            {
                getItem()
            }
        </div>
    )
}
